// Export list of available theme class names and labels
// Ensure corresponding CSS variables are defined for each in index.css

const themePresets = [
  { value: 'theme-rose', label: 'Rose' },
  { value: 'theme-violet', label: 'Violet' },
  { value: 'theme-olive', label: 'Olive' },
  { value: 'theme-ocean', label: 'Ocean' },
  { value: 'theme-sunset', label: 'Sunset' },
  { value: 'theme-forest', label: 'Forest' },
  { value: 'theme-slate', label: 'Slate' },
  { value: 'theme-mint', label: 'Mint/Coral' },
  { value: 'theme-blush', label: 'Blush/Teal' },
  { value: 'theme-vibrant', label: 'Vibrant Warm' }
];

export default themePresets;
